import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';
import { Navbar, Nav, Button, Image } from 'react-bootstrap';
import logo from './direction.svg'


class HeaderNavbar extends Component {


    render() {
        const { openLoginModal } = this.props;

        return(
            <div>
                <Navbar bg="dark" variant="dark" sticky="top" style={{height: 50}}>
                    <Image className='nav-icon' src={logo} rounded fluid/>
                    <Navbar.Brand>Strider Store</Navbar.Brand>
                    <Navbar.Collapse>
                        <Nav justify>
                            <NavLink to='/purchase' className='nav-link'>Purchase</NavLink>
                            <NavLink to='/home' className='nav-link'>Receipts</NavLink>
                            <NavLink to='/about' className='nav-link'>About</NavLink>
                        </Nav>
                        <Nav className="ml-auto">
                            <Button variant="outline-info" onClick={openLoginModal}>Login</Button>
                        </Nav>
                    </Navbar.Collapse>
                </Navbar>
            </div>
        )
    }
}

export default HeaderNavbar;
